עוד
טוענת המבקשת כי ערכאות קמא לא העניקו את המשקל הראוי לנסיבותיה האישיות, ובכלל זה
עבודתה המצטיינת בתחום החינוך לגיל הרך; העובדה שלא עבדה במקצועה כעורכת דין;
העבודה הטיפולית-שיקומית אשר עלולה להיגדע אם תישלח למאסר מאחורי סורג ובריח;
והמלצת שירות המבחן בעניינה לריצוי עונש המאסר בעבודות שירות.

בקשת המשיבה 21 מיום
  7.11.2022 להארכת מועד להגשת תשובתה לערעור; תשובת המשיב 23 מיום 14.11.2022;
  תשובת המשיבים 19-1 מיום 14.11.2022

